// Package airports provides tools for relating airport IATA and IACO codes to airport data
package airports

import (
	"fmt"
)

// Airport holds information about an airport
type Airport struct {
	// Airport name.
	Name string
	// Main city served by airport.
	City string
	// Country or territory where airport is located.
	Country string
	// 3-letter IATA code. Empty if not assigned/unknown.
	IATA string
	// 4-letter ICAO code.
	ICAO string
	// Latitude in decimal degrees.
	Latitude float64
	// Longitude in decimal degrees.
	Longitude float64
	// Altitude in feet.
	Altitude float64
	// Hours offset from UTC. Fractional hours are expressed as decimals
	Timezone float64
	// Daylight savings time. One of E (Europe), A (US/Canada), S (South America), O (Australia), Z (New Zealand), N (None) or U (Unknown).
	DST string
	// Timezone in Olsen format
	Tz string
}

